describe("intersection",function(){it("returns the elements common to all passed arrays",function(){expect(func.intersection([1,2,1,3],[101,3,2,1,10],[3,2,1])).toEqual([1,2,3]);expect(func.intersection([1,2,2,2],[1,3,2,2,10],[1,2,2])).toEqual([1,2]);expect(func.intersection([],[])).toEqual([])})});describe("union",function(){it("returns the unique element aggregation of all passed arrays",function(){expect(func.union([1,2,1,3],[101,3,2,1,10],[3,2,1]).sort()).toEqual([1,2,3,10,101].sort());expect(func.union([1,2],[3,4],[4,5,6])).toEqual([1,2,3,4,5,6])})});describe("reduce",function(){it("boils down a list of values into a single value",function(){expect(func.reduce([1,2,3],function(e,t){return e+t},0)).toEqual(6)})});describe("zip",function(){it("Merges together the values of each of the arrays with the values at the corresponding position",function(){expect(func.zip(["moe","larry","curly"],[30,40,50],[!0,!1,!1])).toEqual([["moe",30,!0],["larry",40,!1],["curly",50,!1]])})});